import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Home = () => {
  const [message, setMessage] = useState('');

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios.get('http://localhost:3000/');
      setMessage(result.data.message);
    };

    fetchData();
  }, []);

  return (
    <div style={{ backgroundColor: 'gray' }}>
  <h1>Home Page</h1>
  <p>{message}</p>
  <div style={{ textAlign: 'center' }}>
    <div style={{ maxWidth: '100vw', height: '50vh' }}>
      <img src="/images/img.png" alt="Amazing Image" style={{ width: 'auto', height: 'auto', maxWidth: '200vh', maxHeight: '100%' }} />
    </div>
    <div style={{ height: '30%', lineHeight: '1.5', display: 'flex', alignItems: 'center', justifyContent: 'center', fontSize: '1.5em', fontWeight: 'bold' }}>Author:</div>
  </div>
</div>


  );
};

export default Home;
